【商品説明】<br><br>原産国：日本<br>ブランド：シュフレ<BR>商品サイズ：60×250×60<br>JANコード：4580383323119<BR>cs：30<BR>商品カテゴリ： キッチン・お掃除用品 ＞ 住居用洗剤 ＞ その他　(230900)<BR>・瞬間強力除菌 インフルエンザやノロなど、アルコールでは除菌できないウイルスも瞬間的に99.9%以上除菌できます。時間をかけずに一瞬で除菌するので空気中に浮遊する細菌やウィルスにも有効。病院の感染経路対策でも使用されています。<br> ・高い安全性 石鹸と同じ弱アルカリ性なので、敏感肌の方でも手荒れを気にせずお使いいただけます。第三者機関で様々な安全性試験を行ない、人体などへの安全面も確認済み。塩素系製品で問題となる発癌性物質のトリハロメタンをはじめ人体に有毒なガスの発生もありません。 <br>・瞬間消臭 環境省指定8大悪臭をはじめ、気になる嫌な臭いを強力に瞬間消臭。塩素系製品にありがちな特有の不快臭もなく、小さなお子様やお年寄り、ペットのいるご家庭でも安心です。<br> ・漂白・腐食しにくい 金属製品に対する腐食は水道水と同程度。漂白もしにくいので、カーペットや布製品等あらゆる場所にお使いいただけます<br>広告文責：アットライフ株式会社<br>TEL 079-280-2113<br>※商品パッケージは変更の場合あり。<br>メーカー欠品または完売の際、キャンセルをお願いすることがあります。ご了承ください。<br><style type="text/css">
