液体部屋干しトップ つめかえ用 600ml<br>ブランド：トップ<br>販売・製造元：ライオン<br><br>「液体部屋干しトップ 760ml」のつめかえ用です。部屋干しした時の、生乾きのイヤなニオイを防ぎます。きなりや淡い色物の衣類にもオススメです。綿・麻・合成繊維のお洗濯用です。 <br>ご使用方法用途：綿・麻・合繊繊維のお洗濯用●水洗いできないものの表示がある衣類には使用できません。●色物には水だけで色落ちするものがあります。初めて洗うときは別洗いで試してみてください。●がんこな汚れには直接塗ってよくなじませてから洗うと、さらに効果的です。洗剤量は洗濯物量と汚れの程度により加減してください              洗濯槽の大きさ        (洗濯物量の目安)               水量(高水位のとき)               使用量                    8.0kg(6.0kg)               65L               43mg                    6.0kg(4.5kg)               60L               40ml                    4.2kg(3.0kg)               45L               30ml       ご使用上の注意・用途外に使わないでください。・荒れ性の方や原液で使うときは炊事用の手袋を使用してください。・使用後は手をよく洗い、クリームなどで手入れをしてください。・洗濯機のフタに原液をつけないでください。ついたままにすると傷むことがあるので充分にふきとってください。 液性弱アルカリ性 成分界面活性剤(43%ポリオキシエチレンアルキルエーテル)、安定化剤、抗菌剤 <br>日用品／洗濯用品／洗濯洗剤／洗剤 衣類用<br>JANコード： 4903301428411<br><br>CS：16<br>広告文責：アットライフ株式会社<br>TEL 079-280-2113<br>※商品パッケージは変更の場合あり。<br>メーカー欠品または完売の際、キャンセルをお願いすることがあります。ご了承ください。<br><style type="text/css">
