ミヨシ 暮らしの重曹 せっけん泡スプレー つめかえ用 230ml<br>ブランド：暮らしの洗浄剤シリーズ<br>販売・製造元：ミヨシ石鹸<br><br>石鹸パワーと重曹の力でしっかり落とす重曹クリーナーです。お風呂場やキッチンまわりの汚れを手早く手軽に洗浄。合成界面活性剤を遣わす、重曹&石鹸の泡・霧が汚れに密着。用途に応じて使い分け化膿な簡単便利の安心クリーナー。詰替え用。 <br>用途*用途*●キッチンまわり(調理用具、グリル、レンジ台、換気扇など)●洗面所、浴室まわり(洗面台、洗面ボウル、浴槽、タイル、プラスチック製品、スチール製品など)●洗濯物の部分洗い(エリ、そで口など)●その他の住居内(床、ビニールクロス、家具、便器)などの汚れ落とし*使えないもの*●皮革、白木、桐など、水拭きできないもの●アルミニウム、銅、しんちゅう、うるしやニス塗りの家具、畳、大理石、液晶画面、自動車の塗装面、反射コーティングしたガラス、メガネなど、その他アルカリ性に対し弱い材質のものなど <br><br>使用方法<br>*お使いになる前に*●家電製品は電源を切ってから、布などにスプレーしてふき取る。●塗装面やワックス処理の床、つや出し剤を使用している家具などは、目立たない部分で変色・シミにならないか試す。この種のものに使用するときは直接スプレーせず、布などにスプレーしてふき取る。●材質等が不明な場合はその商品の取扱説明書に従い、不明な場合は使用しない。●使用後は、水で流すか固く絞った布などで仕上げ拭きをする。*使い方*当製品の専用容器に詰め替えた後、泡の噴射ノズルを上面に合わせ、汚れに直接スプレーするか、布などにスプレーして使用する。使用後は必ず×印に合わせ、立てて保管する。*使用量の目安*約15cm離して、表面がぬれる程度。*詰め替え方*本品専用のボトルをよく水で洗い、乾かしてから詰め替えてください。切り口はボトルの口にひっかけて注げます。・他の製品と混ぜないでください。・パックを強く持つと、液が飛び出すのでご注意<br>ください。 <br><br>使用上の注意<br>●用途以外に使わない。●子供の手の届くところに置かない。●手荒れのする方は炊事用手袋を使用する。●使用後は手を水で良く洗う。●直射日光のあたる場所や、高温になるところに置かない。※こまめなお掃除をお勧めします。こびりついた汚れには不向きです。※必ず当製品専用の容器に詰め替えてください。他の製品と混ぜると変質の原因になります。※オリが発生する場合がありますが、品質には問題ありません。 応急処置●目に入った場合は、こすらずにすぐ水でよく洗い流す。●飲み込んだ場合は水を飲ませるなどの処置をする。●いずれの場合も異常が残る時は本製品を持参し、医師に相談する。 成分純せっけん分(10%脂肪酸カリウム)、アルカリ剤(重曹)液性：弱アルカリ性<br> 原産国日本 <br><br>お問い合わせ先<br>ミヨシ石鹸株式会社お客様相談室TEL：03-3633-6961 <br>日用品／掃除用品／掃除用洗剤／重曹クリーナー<br>JANコード： 4537130101711<br><br>CS：30<br>広告文責：アットライフ株式会社<br>TEL 079-280-2113<br>※商品パッケージは変更の場合あり。<br>メーカー欠品または完売の際、キャンセルをお願いすることがあります。ご了承ください。<br><style type="text/css">
