シークレットアロマカプセル配合（防臭マイクロカプセル）で香り長続き。７つのハーブ成分配合で衣類をケア（衣類をやさしく保護）。抗菌剤配合で室内に干しても香り快適。服をこすれば香りが深まります。<br><br><br>サフロン バイオレットの香り 詰替 540ml<br>香りを包んだカプセルがはじけて香りが長続きする柔軟剤です。サフロンで仕上げた後、繊維に香りのカプセルが付着し、着ている時に動くたびにはじけだし、バイオレットの香りをお届けします。香りが違うと服だけでなく、生活も楽しく変えられるという期待感が高まります。日常生活で起こる楽しいエピソードが生活のアクセントに。  用途衣類品用(綿、毛、化学せんい等) 使用量の目安水1Lに0.33ml 使用上の注意・用途以外に使わない。・子供の手の届くところに置かない。・柔軟仕上げ剤の自動投入口を使う場合は、洗濯機の取扱い説明書をお読み下さい。・原液が直接衣類にかからないようにする。*応急処置*・目に入ったときは、こすらずにすぐ流水で15分以上洗い流し、眼科医に相談する。受診時は商品を持参する。・飲みこんだ時は吐かずにすぐ口をすすぎ、水か牛乳を飲む等の処置をする。 詰め替え方他の製品と混ぜると変質することがあります。ボトルは洗ってからお詰め下さい。<br> 成分<br>界面活性剤(エステル型ジアルキルアンモニウム塩)、抗菌剤 柔軟剤とは柔軟剤は、洗濯後の衣類の静電気を防止し、ふんわりとした柔軟性を与えるための仕上げ剤です。香りが長く続く柔軟剤、防臭タイプの柔軟剤、乾燥機専用の柔軟剤シートなどが揃っています。 <br>販売_製造元： LGジャパン<br>ブランド：サフロン<br>JAN：4985275795041<br>CS：18<br>広告文責：アットライフ株式会社<br>TEL 079-280-2113<br>※商品パッケージは変更の場合あり。<br>メーカー欠品または完売の際、キャンセルをお願いすることがあります。ご了承ください。<br><style type="text/css">
